const ProductImages = (props) => {
    
   // props.gallery.images.forEach(element => console.log(element.path));
    
    return (
        <div className="product-images">
          <img src={props.gallery.images.forEach(element => element.path)} />
        </div>
      );
}

export default ProductImages;
